full_reasoning:
Step-by-step reasoning:

1. Key psychological mechanisms: Responder behavior is influenced not only by the absolute monetary gain offered (split_self) but also by how that offer compares to what the responder “deserves” based on a fairness benchmark. The fairness benchmark is naturally computed by the relative token contributions: the responder’s token_self relative to the total tokens (token_self + token_opp) multiplied by the combined total earnings. Deviations from this fair share (either below or above) can have negative subjective value—people are especially sensitive (loss‐averse) when they get less than what is “fair” and may also be averse to overly generous offers (which might induce guilt or perceived responsibility).

2. How these mechanisms interact: The subjective utility is assumed to increase with the offered monetary share via a diminishing sensitivity (captured by the logarithm of split_self). From this is subtracted a fairness “cost” that increases with the normalized size of the deviation from the fair share. Importantly, disadvantageous deviations (split_self below the fair share) and advantageous deviations (split_self above the fair share) are penalized differently using asymmetric parameters.

3. Mathematical form: 
 – Compute F, the fair share, as (token_self / (token_self + token_opp)) × combined_earning.
 – Compute the deviation d = split_self – F.
 – Use ln(split_self) as the subjective reward (capturing diminishing sensitivity).
 – Subtract a penalty term that is a linear function of the normalized deviation. Use max(–d,0) for disadvantageous deviations and max(d,0) for advantageous deviations.
 Thus, the penalty term is θ × [max(–d, 0)/(combined_earning)] for disadvantageous inequity, and δ × [max(d, 0)/(combined_earning)] for advantageous inequity.

4. Learnable parameters to calibrate the model: Two parameters are introduced:
 • theta (θ) – the penalty parameter for disadvantageous deviations,
 • delta (δ) – the penalty parameter for advantageous deviations.
 Both parameters are set with generous finite bounds.

5. Mapping model variables to observable behavior: All variables are drawn directly from the dataset (token_self, token_opp, combined_earning, split_self). The model calculates a subjective utility U_accept for accepting the offer. Negative utility values (resulting from large fairness penalties relative to the offered split) predict a low likelihood that the responder accepts the offer.

Below is the formal specification.

<MODEL>
Let F = (token_self / (token_self + token_opp)) * combined_earning  
Let d = split_self - F  
U_accept = ln(split_self) - [ theta * (max(-d, 0) / combined_earning) + delta * (max(d, 0) / combined_earning) ]
</MODEL>

